398c57ab-5e3d-4e2a-9ab1-77107cb3920e	2025-11-14 12:51:20.099+00	2025-11-16 17:10:00.114+00	cb7d15e0-079a-4ec7-98b8-b25672f57e70	08a5dcba-92ce-48b7-829d-776b7ac5d4f9	Лебедев Захар Сергеевич	Основатель Бюро, управляющий партнёр	Мы стремимся предоставлять юридические услуги высочайшего качества за разумную стоимость, основываясь на принципах профессионализма, ответственности и доверия.	["Гражданские дела","Семейные споры","Трудовые споры","Административные дела","Арбитражный суд"]	<p>В 2015 году основал адвокатское бюро &laquo;Лебедев и партнёры&raquo;. Имеет более 15 лет опыта представления интересов клиентов в судах различных инстанций. Сфера практических интересов &mdash; сопровождение деятельности юридических лиц, арбитражные споры и брачно-семейные дела.</p>\n<p>Стаж работы:&nbsp;<strong>7 лет</strong></p>\n<p>Регистрационный № в реестре адвокатов Российской Федерации: <strong>63/3058</strong></p>	<h2>Контактная информация</h2>\n<p><strong>Телефон:</strong> <a href="tel:+7(777)777-77-77" target="_blank" rel="noopener">+7 (777) 777-77-77</a></p>\n<p><strong>Email:</strong> <a href="mailto:example@mail.ru" target="_blank" rel="noopener">example@mail.ru</a></p>	[{"resource":"Комерсантъ","title":"Комментарий о работе бюро","link":"https://example.com"},{"resource":"АИФ","title":"Комментарий о работе бюро","link":"https://example.com"},{"resource":"Youtube-канал \\"СПАС\\"","title":"Комментарий о работе бюро","link":"https://example.com"}]	[{"title":"Образование","content":"<p>Окончил МГУ им. М.В. Ломоносова по специальности &laquo;Юриспруденция&raquo;. Проходил стажировку в Германии по вопросам арбитражного регулирования. Имеет степень кандидата юридических наук.</p>"},{"title":"Достижения","content":"<p>Лауреат премии &laquo;Юрист года&raquo; в 2020 году. Успешно завершил более 300 дел в арбитражных судах. Регулярно выступает на профильных конференциях.</p>"}]
