4972cd5e-4ee9-4f93-845b-c663ca1362b8	2025-11-16 21:40:35.726+00	\N	Политика конфиденциальности	<h2>1. Обзор</h2>\n<h3>1.1 Наши Ценности</h3>\n<p>В Бойцовском Клубе мы подчёркиваем уважение, дисциплину и товарищество среди наших членов. Этот документ описывает ключевые правила, которые регулируют наш клуб и обеспечивают безопасный и приятный опыт для всех.</p>\n<h3>2.2 Правила Участия</h3>\n<p>Члены должны добровольно соглашаться участвовать в боях и носить подходящее защитное снаряжение. Безопасность является нашим высшим приоритетом.</p>\n<h2>2. Проведение Боя</h2>\n<h3>2.1 Уважайте Соперника</h3>\n<p>Все бойцы должны проявлять уважение к своим соперникам как внутри, так и вне ринга. Личные нападки или недостойное поведение не будут терпимы.</p>\n<h2>3. Поведение После Боя</h2>\n<h3>3.1 Поддерживайте Соперников</h3>\n<p>После боя члены поощряются поздравлять своих соперников и оказывать поддержку, независимо от результата.</p>\n<h2>4. Протоколы Безопасности</h2>\n<h3>4.1 Экстренные Процедуры</h3>\n<p>В случае травмы члены должны немедленно сообщить рефери и при необходимости обратиться за медицинской помощью.</p>\n<h2>5. Возрастные Требования</h2>\n<h3>5.1 Требования к Участникам</h3>\n<p>Участники должны быть не младше 18 лет, чтобы присоединиться к Бойцовскому Клубу.</p>\n<h2>6. Свяжитесь с Нами</h2>\n<h3>6.1 Обратная Связь</h3>\n<p>По любым вопросам или проблемам, касающимся этих правил, пожалуйста, свяжитесь с нами по адресу&nbsp;<a href="https://example.com/" target="_blank" rel="noopener">info@fightclub.com</a>.</p>
\.
